import data from "./data";

function App() {
  return (
    <div className="App">
      <header
        className="bg-[#403493] p-4
      "
      >
        <a href="/" className="text-[#F9F7F3] font-bold no-underline">
          WCC
        </a>
      </header>
      <main>
        <h1>Featured Products</h1>
        {data.products.map((product) => (
          <div>
            <img src={product.image} alt={product.name} />
            <p>{product.name}</p>
            <p>{product.price}</p>
          </div>
        ))}
      </main>
    </div>
  );
}

export default App;
